import React from 'react';

import './TrackList.css';

class TrackList extends React.Component {
    render() {
      return (
        <div className="TrackList">
            {/* <!-- add a map method Track, Artist, Album--> */}
            <h3>track name </h3>
          <p>track artist| track album></p>
        </div>
      ) }
    }
export default TrackList;
